select
 try_cast('2021/03/16' as date) referencia,
 try_cast(trim(cnpj_basico) as bigint) cnpj_basico,
 try_cast(trim(cnpj_ordem) as int) cnpj_ordem,
 try_cast(trim(cnpj_dv) as int) cnpj_dv,
 try_cast(trim(id_matriz_filial) as smallint) id_matriz_filial,
 cast(trim(nm_fantasia) as nchar(60)) nm_fantasia,
 try_cast(trim(sit_cadastral) as smallint) situacao_cadastral,
 try_cast(concat(substring(trim(dt_sit_cadastral),1,4),'/',
                 substring(trim(dt_sit_cadastral),5,2),'/',
                 substring(trim(dt_sit_cadastral),7,2)) as date) dt_situacao_cadastral,
 try_cast(trim(motivo_sit_cadastral) as smallint) motivo_sit_cadastral,
 cast(trim(nm_cidade_exterior) as nchar(60)) nm_cidade_exterior,
 try_cast(trim(pais) as smallint) pais,
 try_cast(concat(substring(trim(dt_inicio_atividade),1,4),'/',
                 substring(trim(dt_inicio_atividade),5,2),'/',
                 substring(trim(dt_inicio_atividade),7,2)) as date) dt_inicio_atividade,
 try_cast(trim(cnae_fiscal) as bigint) cnae_fiscal,
 trim(cnae_secundaria) cnae_secundaria,
 cast(trim(tp_logradouro) as nchar(25)) tp_logradouro,
 cast(trim(logradouro) as nchar(65)) logradouro,
 cast(trim(numero) as nchar(6)) numero,
 cast(trim(complemento) as nchar(160)) complemento,
 cast(trim(bairro) as nchar(55)) bairro,
 cast(trim(cep) as nchar(8)) cep,
 cast(trim(uf) as nchar(2)) uf,
 try_cast(trim(municipio) as int) municipio,
 try_cast(trim(ddd1) as smallint) ddd1,
 try_cast(trim(telefone1) as bigint) telefone1,
 try_cast(trim(ddd2) as smallint) ddd2,
 try_cast(trim(telefone2) as bigint) telefone2,
 try_cast(trim(ddd_fax) as smallint) ddd_fax,
 try_cast(trim(fax) as bigint) fax,
 cast(trim(email) as nchar(120)) email,
 cast(trim(sit_especial) as nchar(30)) sit_especial
into raisdes.dados_estabelecimentos
from tmp;



